// components/Home/index.js
import React, { useEffect, useState } from 'react';
import './Home.css';

function Home() {
  const [marketOverview, setMarketOverview] = useState(null);

  useEffect(() => {
    // Define API key and endpoint
    const apiKey = '43IONELH5RJI3THA';
    const symbols = ['DJI', 'SPX', 'IXIC']; // Dow Jones, S&P 500, and NASDAQ

    // Fetch market overview data for each symbol
    Promise.all(symbols.map(symbol => 
      fetch(`https://www.alphavantage.co/query?function=GLOBAL_QUOTE&symbol=${symbol}&apikey=${apiKey}`)
        .then(response => response.json())
    ))
    .then(data => {
      // Process the fetched data and set the state
      setMarketOverview(data);
    })
    .catch(error => {
      console.error('Error fetching market overview:', error);
    });
  }, []);

  return (
    <div className="home">
      <div className="market-overview">
        {marketOverview ? (
          marketOverview.map((overview, index) => (
            <div key={index} className="market-item">
              <h3>{overview['Global Quote']['01. symbol']}</h3>
              <p>Open: ${overview['Global Quote']['02. open']}</p>
              <p>High: ${overview['Global Quote']['03. high']}</p>
              <p>Low: ${overview['Global Quote']['04. low']}</p>
              <p>Price: ${overview['Global Quote']['05. price']}</p>
              <p>Volume: {overview['Global Quote']['06. volume']}</p>
            </div>
          ))
        ) : (
          <p>Loading...</p>
        )}
      </div>
      {/* Render other elements, e.g., welcome text */}
    </div>
  );
}

export default Home;
